// set the dimensions and margins of the graph
var margin = { top: 10, right: 30, bottom: 30, left: 60 },
  width = 1000 - margin.left - margin.right,
  height = 600 - margin.top - margin.bottom;
// append the svg object to the body of the page
var svg = d3
  .select("#TSNE")
  .append("svg")
  .attr("width", width + margin.left + margin.right)
  .attr("height", height + margin.top + margin.bottom)
  .append("g")
  .attr("transform", "translate(" + margin.left + "," + margin.top + ")");

var bound = 25;
var x = d3
  .scaleLinear()
  .domain([-bound, bound])
  .range([0, width]);

var y = d3
  .scaleLinear()
  .domain([-bound, bound])
  .range([0, height]);

svg
  .append("g")
  .attr("class", "x axis")
  .attr("transform", "translate(0," + height + ")");
svg.append("g").attr("class", "y axis");

function update(data, i) {
  console.log(data);
  d3.selectAll("circle")
    .transition()
    .duration(100)
    .delay(function(d, i) {
      return i * 150;
    })
    .attr("class", "exit")
    .remove();
  svg
    .append("g")
    .selectAll(".point")
    .data(data)
    .enter()
    .append("circle")
    .attr("iteration", i)
    .attr("class", "point")
    .attr("cx", function(d) {
      return x(d[0]);
    })
    .attr("cy", function(d) {
      return y(d[1]);
    })
    .attr("r", 2.0)
    .style("fill", "orange");
}

